INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "オッドアイ", 6, "両目でそれぞれ瞳の色が異なること。いろいろな動物に見られるが、特に猫に多い", 12458, 5, 12452, 12489, 12483, "これ、何と言う？", 5, 12450, "", 2, 5, "オッドアイ", 2, 0, 6177, 5);
