INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ドラキュラ", 6, "非常によく知られた怪物。獲物の血を吸うのが特徴で、十字架やニンニクが弱点とされる", 12489, 5, 12521, 12461, 12521, "これ、何と言う？", 5, 12517, "", 1, 5, "ドラキュラ", 2, 0, 6179, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ンコロガシ", 6, "動物のフンをボール状にして、コロコロ転がすという変わった習性を持つ昆虫", 12531, 5, 12471, 12525, 12467, "これ、何と言う？", 5, 12460, "", 1, 5, "フンコロガシ", 2, 0, 6180, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ラグドール", 6, "「ぬいぐるみ」という意味を持つ、猫の種類。抱っこが好きで、毛並みがフサフサなことから", 12521, 5, 12523, 12489, 12464, "これ、何と言う？", 5, 12540, "", 3, 5, "ラグドール", 2, 0, 6181, 5);
