INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (4, "いいなずけ", 6, "若いうちから結婚が約束された相手のこと", 12356, 4, 12369, 12394, 12356, "これ、何と読む？", 4, 12378, "", 2, 4, "許嫁＝いいなずけ", 2, 0, 6236, 4);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (4, "やたがらす", 6, "「古事記」などに登場する、三本足の神聖なカラス", 12420, 4, 12377, 12364, 12383, "これ、何と言う？", 4, 12425, "", 3, 4, "やたがらす", 2, 0, 6237, 4);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (4, "さごじょう", 6, "「西遊記」で孫悟空と行動を共にする、河童の姿のキャラクター", 12373, 4, 12358, 12376, 12372, "これ、何と言う？", 4, 12423, "", 2, 4, "さごじょう", 2, 0, 6238, 4);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ディーラー", 6, "カジノで、ルーレットを回したりカードを配ったりとゲームの進行を行う役目", 12487, 5, 12540, 12540, 12451, "これ、何と言う？", 5, 12521, "", 2, 5, "ディーラー", 2, 0, 6239, 5);
