INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ガンスミス", 6, "銃のメンテナンスを職業として行う人のこと", 12460, 5, 12473, 12473, 12531, "これ、何と言う？", 5, 12511, "", 3, 5, "ガンスミス", 2, 0, 6241, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ハイビスカ", 6, "熱帯の地域を象徴する花で、カオリの故郷でも親しまれる。赤や黄色の鮮やかな花びらをつける", 12495, 5, 12459, 12499, 12452, "これ、何と言う？", 5, 12473, "", 1, 5, "ハイビスカス", 1, 0, 6242, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "オウィスプ", 6, "「ひとだま」と呼ばれる超常現象、英語で言うと？", 12458, 5, 12503, 12451, 12454, "これ、何と言う？", 5, 12473, "ウィル・オ・ウィスプ", 3, 5, "ウィル・オ・ウィスプ", 2, 0, 6243, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "ニシキゴイ", 6, "魚の「鯉」の中でも観賞用として好まれる種で、高級な織物の柄によく似ていることが由来", 12491, 5, 12452, 12461, 12471, "これ、何と言う？", 5, 12468, "", 2, 5, "ニシキゴイ", 2, 0, 6244, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "レサパンダ", 6, "「小さなパンダ」が由来の、動物園の人気者", 12524, 5, 12480, 12497, 12469, "これ、何と言う？", 5, 12531, "レッサーパンダ", 1, 5, "レッサーパンダ", 2, 0, 6245, 5);
INSERT INTO `v1_b5c296b4c123940a387bbbcfebcf7081e945a2211aa30b2e69bf315c66f3b966` VALUES (5, "アナコンダ", 6, "ヘビの一種で、大きなものでは数メートルもある。映画で恐ろしいヘビとして描かれることが多い", 12450, 5, 12480, 12467, 12490, "これ、何と言う？", 5, 12531, "", 1, 5, "アナコンダ", 2, 0, 6246, 5);
